import logo from './logo.svg';
import React from 'react';
import './App.css';
import AdminAuthForm from './Components/Authform/adminauthform';
import UserAuthForm from '../src/Components/Authform/userauthform';
import AdminHomePage from './Components/adminhomepage/Adminhome';
import UserHomePage from './Components/userhomepage/Userhome';
import { BrowserRouter,Router, Routes, Route} from 'react-router-dom';


{/* <UserAuthForm action="User Sign Up" />
<AdminAuthForm action="Admin Sign Up" />
 <UserHomePage/>
 <AdminHomePage/>
  */}
function App() {
  return (
     <BrowserRouter>
          <div className='App'>
        <Routes>
        <Route path="/auth/userlogin" element={<UserAuthForm/>} />
          <Route path="/auth/userregister" element={<UserAuthForm/>}/>
          <Route path="/auth/admilogin" element={<AdminAuthForm/>} />
          <Route path="/auth/adminregister" element={<AdminAuthForm/>}/>
        </Routes>
    </div>
     </BrowserRouter>
  );
}

export default App;
